import style from "../Card/Card.module.css";

export const Card = ({ name, background_image, genres }) => {
  return (
    <div
      className={style?.containt}
      style={{ backgroundImage: `url(${background_image})` }}
    >
      {/* <img src={background_image} className={style.image} alt="" /> */}
      <div className={style.card - content}>
        <h2>Name: {name}</h2>
        <h2>Genres: {genres}</h2>
      </div>
    </div>
  );
};
